import React, { Component } from "react";
import '../../App.css';
import Data from './cities.json';

class Home extends Component{
    render(){
        return(
            <div>
                <center>
                <h1>Hello There</h1>
                {Data.map((citiesDetail, index) => {
                    return <h1>{ citiesDetail.name }</h1>
                })}
                </center>
            </div>
        )
    }
}

export default Home
